import Layout from "../components/Layout";

const Home = props => {
  return (
    <Layout>
      <div className=" home no-main-padding d-flex justify-center"></div>
      <div className="paints-container d-flex justify-center flex-column">
        <img className="paint" src="/images/paint1.jpg" alt="" />
      </div>
      <style jsx>
        {`
          .home {
            background-image: url("/images/home5-empty.png");
            background-size: cover;
            background-position: center;
            height: calc(100vh - 160px);
            width: calc(100vw - 40px);
            position: fixed;
            top: 140px;
          }
          .paints-container {
            margin-top: 90px;
          }
          .paint {
            width: 191px;
            height: 191px;
            opacity: 1;
          }
        `}
      </style>
    </Layout>
  );
};

export default Home;
